import React, { useEffect, useState } from "react";
import axios from "axios";
import Select from "react-dropdown-select";
import { Form, FormGroup, FormLabel, FormControl, Button } from "react-bootstrap";
import "../assests/App.css";

const Menu = () => {
  const [parcels, setParcels] = useState([]);
  const [selectedState, setSelectedState] = useState(null);
  const [selectedDistrict, setSelectedDistrict] = useState(null);
  const [selectedTaluk, setSelectedTaluk] = useState(null);
  const [selectedHobli, setSelectedHobli] = useState(null);
  const [selectedVillage, setSelectedVillage] = useState(null);
  const [parcelNo, setParcelNo] = useState('');
  const [formVisible, setFormVisible] = useState(false);

  useEffect(() => {
    // Fetch all parcels using Axios
    axios
      .get("http://127.0.0.1:5000/parcel")
      .then((response) => {
        if (!response.data) {
          throw new Error("Empty response or response data is not valid JSON");
        }
        setParcels(response.data);
      })
      .catch((error) => console.error("Error fetching parcels:", error));
  }, []);

  // Function to get unique values for a given field
  const getUniqueValues = (field) => {
    const uniqueValues = [...new Set(parcels.map((parcel) => parcel[field]))];
    return uniqueValues.map((value) => ({
      value,
      label: `${value}`,
    }));
  };

  // Function to handle form submission
  const handleFormSubmit = () => {
    // Implement your form submission logic here
    console.log("Form submitted:", {
      selectedState,
      selectedDistrict,
      selectedTaluk,
      selectedHobli,
      selectedVillage,
      parcelNo,
    });
  };

  return (
    <div className="menu">
      <div className="container">
        <h1>Select the Farm</h1>

        {/* State Dropdown */}
        <Select
          className="select"
          id="stateDropdown"
          options={getUniqueValues("KGISStateName")}
          value={selectedState}
          onChange={(values) => {
            setSelectedState(values[0]);
            setSelectedDistrict(null);
            setSelectedTaluk(null);
            setSelectedHobli(null);
            setSelectedVillage(null);
            setFormVisible(false);
          }}
          placeholder="Select State"
        />

        {/* District Dropdown */}
        {selectedState && (
          <Select
            className="select"
            id="districtDropdown"
            options={getUniqueValues("KGISDistrictName")}
            value={selectedDistrict}
            onChange={(values) => {
              setSelectedDistrict(values[0]);
              setSelectedTaluk(null);
              setSelectedHobli(null);
              setSelectedVillage(null);
              setFormVisible(false);
            }}
            placeholder="Select District"
          />
        )}

        {/* Taluk Dropdown */}
        {selectedDistrict && (
          <Select
            className="select"
            id="talukDropdown"
            options={getUniqueValues("KGISTalukName")}
            value={selectedTaluk}
            onChange={(values) => {
              setSelectedTaluk(values[0]);
              setSelectedHobli(null);
              setSelectedVillage(null);
              setFormVisible(false);
            }}
            placeholder="Select Taluk"
          />
        )}

        {/* Hobli Dropdown */}
        {selectedTaluk && (
          <Select
            className="select"
            id="hobliDropdown"
            options={getUniqueValues("KGISHobliName")}
            value={selectedHobli}
            onChange={(values) => {
              setSelectedHobli(values[0]);
              setSelectedVillage(null);
              setFormVisible(false);
            }}
            placeholder="Select Hobli"
          />
        )}

        {/* Village Dropdown */}
        {selectedHobli && (
          <Select
            className="select"
            id="villageDropdown"
            options={getUniqueValues("KGISVillageName")}
            value={selectedVillage}
            onChange={(values) => {
              setSelectedVillage(values[0]);
              setFormVisible(true);
            }}
            placeholder="Select Village"
          />
        )}

        {/* Parcel Number Input at the Bottom */}
        <Form>
          <FormGroup controlId="parcelNo">
            <FormLabel>Parcel Number:</FormLabel>
            <FormControl
              type="number"
              value={parcelNo}
              onChange={(e) => setParcelNo(e.target.value)}
              placeholder="Enter Parcel Number"
            />
          </FormGroup>
        </Form>

        {/* Conditional Rendering of Form */}
        {formVisible && (
          <div>
            <h2>Additional Details</h2>
            <Form>
              {/* Add your form fields here */}
              <Button variant="primary" onClick={handleFormSubmit}>
                Submit
              </Button>
            </Form>
          </div>
        )}
      </div>
    </div>
  );
};

export default Menu;
